import React from 'react'

const MainList = ({blogdata}) => {
    console.log("component is loading");

    if (JSON.stringify(blogdata) !== "[]") {
        return (
            <div className='bg-green-300 container lg:w-[80%] md:w-[80%] w-[95%] mx-auto h-screen flex justify-center items-center'>
                <div className='w-[100%] md:w-[80%] lg:w-[80%] bg-amber-500'>
                    <div className='w-[90%] md:w-[80%] lg:w-[80%] mx-auto font-bold text-center text-sm md:text-base lg:text-xl my-4'>
                        အိပ်မက်ဆိုင်ရာ အတိတ်များအား အကရာစဥ်အလိုက်ရှာရန်
                    </div>
                <div className='w-[100%] md:w-[80%] lg:w-[80%] bg-red-300 grid grid-cols-5 gap-x-2 gap-y-3 mx-auto'>
                 {
                    blogdata.map(bda => {
                        return [
                            <button className='bg-blue-300 text-xs md:text-sm lg:text-base rounded-md drop-shadow-lg'>
                                <span className='text-xl font-bold'>{bda.BlogTitle[2]}</span> <br/>
                                <span className='text-xs'>{bda.BlogTitle.slice(6,bda.BlogTitle.length) }</span>
                            </button>
                        ]
                    })
                 }
                </div>
                </div>
            </div>
          )
    }
}

export default MainList
